import Banner from "./component/Banner/Banner";
import Layout from "./component/Layout/Layout";
import LogoList from "./component/LogoList/LogoList";

function App() {
    return (
        <Layout>
    <Banner/>
      <main>
      <LogoList/>
      <Image/>
       <section className="gallery-image-card">gallery image card</section>
       <section className="galery-image-card">gallery image card</section>
       <section className="testimonial">testimonial</section>
       <section className="image-text">image text</section>
       <section className="image-text">image text</section>
       <section className="galery-image-card">gallery image card</section>
       <section className="brand">brand</section>
       <section className="blog">blog</section>
       <section className="news-letter">news letter</section>
      </main>



        </Layout>


    );
}

export default App;


